--------------------------------------------------------
--  DDL for View HV_COVERAGE
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "RIGEL"."HV_COVERAGE" ("PROVISION_AMT", "NPA_AMT", "COVERAGE", "ACCOUNT_ID") AS 
  SELECT HA.PROVISIONS_BASE_AMOUNT PROVISION_AMT,
  HA.TOTAL_PRIN_OS_BASE_AMOUNT NPA_AMT,
  round((NVL(HA.PROVISIONS_BASE_AMOUNT,0)/NVL(HA.TOTAL_PRIN_OS_BASE_AMOUNT,0)),5) COVERAGE,
  HA.ACCOUNT_ID
FROM HI_ACCOUNT H,
  HI_ACCOUNT_SNAPSHOT HA
WHERE HA.ACCOUNT_ID     = H.ACCOUNT_ID
AND H.ORG_ID            = 777
AND H.FF_D1             = HA.TXN_DT
AND TRIM(H.NPA_STATUS) IN( 'NON-NPA', 'D-2', 'SUB STD', 'D-3', 'D-1', 'LOSS' );
REM INSERTING into RIGEL.HV_COVERAGE
SET DEFINE OFF;
